Summary: 
&lt;b&gt;Mad Men&lt;/b&gt; is a smart and cinematic drama about the professional lives, social mores and sexual exploits of advertising executives on Madison Avenue circa 1960, when the industry was at its height of glamour, power, and prestige. The setting is the Sterling Cooper agency, which sells everything from cigarettes to political candidates. The protagonist, Don Draper, is a fast-rising creative director whose smooth exterior conceals any number of secrets.

